INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 4, 10021, 24015, 0.0, 24, "2019/07/31 12:00:00", 0.0, 0.0, 1);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 4, 1, 10021, 24016, 0.0, 24, "2019/07/31 12:00:00", 0.0, 4.0, 2);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 4, 10021, 24017, 0.0, 24, "2019/07/31 12:00:00", 0.0, 0.0, 3);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 1, 2, 10021, 24018, 0.0, 24, "2019/07/31 12:00:00", 0.0, 5.2, 4);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, 6, 10021, 24019, 0.0, 24, "2019/07/31 12:00:00", 0.0, 4.2, 5);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 2, 10021, 24020, 0.0, 24, "2019/07/31 12:00:00", 0.0, 0.0, 6);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 1, 6, 10021, 24021, 0.0, 24, "2019/07/31 12:00:00", 0.0, 6.4, 7);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 2, 10021, 24022, 0.0, 24, "2019/07/31 12:00:00", 0.0, 0.0, 8);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 6, 3, 10021, 24023, 0.0, 24, "2019/07/31 12:00:00", 0.0, 10.08, 9);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 1, 2, 10021, 24024, 0.0, 24, "2019/07/31 12:00:00", 0.0, 5.0, 10);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES ("カオリ（サマー）", "2030/12/17 14:59:59", 110501, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 2, 10021, 24025, 0.0, 24, "2019/07/31 12:00:00", 0.0, 0.0, 11);
